import h from '../Header/Header.module.scss'
import logo from '../img/Logo.svg'
import group from '../img/Group.svg'
import user from '../img/User.svg'
import { useEffect, useRef, useState } from 'react'

import item1 from '../img/item1.svg'
import item2 from '../img/item2.svg'
import item3 from '../img/item3.svg'
import item4 from '../img/item4.svg'
import item5 from '../img/item5.svg'
import item6 from '../img/item6.svg'

import bar1  from '../img/bar1.svg'
import bar2  from '../img/bar2.svg'
import bar3  from '../img/bar3.svg'
import bar4  from '../img/bar4.svg'
import bar5  from '../img/bar5.svg'
import bar6  from '../img/bar6.svg'
import bar7  from '../../pages/statistics/img/Рекламодатели.svg'
import bar8  from '../../pages/statistics/img/Площадка.svg'
import bar9  from '../../pages/statistics/img/Аукционы.svg'
import bar10  from '../../pages/statistics/img/Рекламные.svg'

import setting  from '../img/Setting.svg'
import arrow  from '../img/Arrow.svg'
import { Link, useLocation, useNavigate } from 'react-router-dom'


export default function Header () {


    const [AdminActive, setAdminActive] = useState(false)


    const AdminActiveFalse = () => {
        setAdminActive(!AdminActive)

        setbalanceHandle(false)
        setShowContent(false);
        setShowContentTwo(false);
        setShowContentThree(false);
        setShowContentfive(false);
        setShowContentfour(false);
        setburgerActive(false)


    }

  const [showContent, setShowContent] = useState(false);

  const [showContentTwo, setShowContentTwo] = useState(false);

  const [showContentThree, setShowContentThree] = useState(false);

  const [showContentfour, setShowContentfour] = useState(false);

  const [showContentfive, setShowContentfive] = useState(false);

  const [showContentsix, setShowContentsix] = useState(false);


  const [balanceHandle, setbalanceHandle] = useState(false);

  const timerRef = useRef(null);

  const balanceOne = () => {

    setbalanceHandle(true)
    setShowContentsix(false)
    setShowContent(false);
    setShowContentTwo(false);
    setShowContentThree(false);
    setShowContentfive(false);
    setShowContentfour(false);
    setAdminActive(false)

    clearTimeout(timerRef.current); 
  };

  const balanceOneClose = () => {
    timerRef.current = setTimeout(() => {
        setbalanceHandle(false)
    }, 500); 

    setShowContentTwo(false);
    setShowContent(false);
    setShowContentThree(false);
    setShowContentfive(false);
    setShowContentfour(false);
    setAdminActive(false)
    setShowContentsix(false)


  };

  const handleMouseEnter = () => {
    setShowContent(true);

    setShowContentTwo(false);
    setShowContentThree(false);
    setShowContentfive(false);
    setShowContentfour(false);
    setbalanceHandle(false)
    setAdminActive(false)
    setShowContentsix(false)


    clearTimeout(timerRef.current); 
  };

  const handleMouseLeave = () => {
    timerRef.current = setTimeout(() => {
      setShowContent(false);
    }, 500); 

    setShowContentTwo(false);
    setShowContentThree(false);
    setShowContentfive(false);
    setShowContentfour(false);
    setAdminActive(false)
    setbalanceHandle(false)
    setShowContentsix(false)


  };

  const MouseTwo = () => {
    setShowContentTwo(true);

    setShowContent(false);
    setShowContentfour(false);
    setShowContentfive(false);
    setAdminActive(false)
    setShowContentThree(false);
    setbalanceHandle(false)
    setShowContentsix(false)


    clearTimeout(timerRef.current); 
  };

  const MouseLeaveTwo = () => {
    timerRef.current = setTimeout(() => {
      setShowContentTwo(false);
    }, 500); 

    setShowContent(false);
    setShowContentThree(false);
    setShowContentfive(false);
    setAdminActive(false)
    setShowContentfour(false);
    setbalanceHandle(false)
    setShowContentsix(false)


  };

  const MouseThree = () => {

    setShowContentTwo(false);
    setShowContent(false);
    setShowContentfour(false);
    setShowContentfive(false);
    setAdminActive(false)
    setbalanceHandle(false)
    setShowContentsix(false)

    setShowContentThree(true);
    clearTimeout(timerRef.current); 
  };

  const MouseLeaveThree = () => {

    timerRef.current = setTimeout(() => {
      setShowContentThree(false);
    }, 500); 

    setShowContentTwo(false);
    setShowContent(false);
    setShowContentfour(false);
    setAdminActive(false)
    setShowContentfive(false);
    setbalanceHandle(false)
    setShowContentsix(false)


  };


  const Mousefour = () => {

    setShowContentTwo(false);
    setShowContentThree(false);
    setShowContent(false);
    setShowContentfive(false);
    setbalanceHandle(false)
    setAdminActive(false)
    setShowContentsix(false)

    setShowContentfour(true);
    clearTimeout(timerRef.current); 
  };

  const MouseLeavefour = () => {

    timerRef.current = setTimeout(() => {
      setShowContentfour(false);
    }, 500); 

    setShowContentTwo(false);
    setShowContent(false);
    setAdminActive(false)
    setbalanceHandle(false)
    setShowContentThree(false);
    setShowContentfive(false);
    setShowContentsix(false)



  };

  const Mousefive = () => {

    setShowContentTwo(false);
    setShowContentThree(false);
    setShowContent(false);
    setbalanceHandle(false)
    setShowContentfour(false);
    setAdminActive(false)
    setShowContentsix(false)


    setShowContentfive(true);
    clearTimeout(timerRef.current); 
  };

  const MouseLeavefive = () => {

    timerRef.current = setTimeout(() => {
      setShowContentfive(false);
    }, 500); 

    setShowContentTwo(false);
    setShowContent(false);
    setShowContentfour(false);
    setAdminActive(false)
    setShowContentThree(false);
    setbalanceHandle(false)
    setShowContentsix(false)

  };

  const MouseLeavesix = () => {

    timerRef.current = setTimeout(() => {
      setShowContentsix(true)
    }, 500); 

    setShowContentTwo(false);
    setShowContent(false);
    setShowContentfour(false);
    setAdminActive(false)
    setShowContentThree(false);
    setbalanceHandle(false)
    setShowContentfive(false);


  };


  const [slideBar, setSlideBar] = useState(false)

  const slideBarActivFalse = () => {
    setSlideBar(!slideBar)

    setSlideBarTwo(false)
    setSlideBarThree(false)
    setSlideBarFour(false)
    setSlideBarFive(false)
    setSlideBarSix(false)


  }

  const [slideBarTwo, setSlideBarTwo] = useState(false)

  const slideBarActivFalseTwo = () => {
    setSlideBarTwo(!slideBarTwo)

    setSlideBar(false)
    setSlideBarThree(false)
    setSlideBarFour(false)
    setSlideBarFive(false)
    setSlideBarSix(false)


  }

  const [slideBarThree, setSlideBarThree] = useState(false)

  const slideBarActivFalseThree = () => {
    setSlideBarThree(!slideBarThree)

    setSlideBar(false)
    setSlideBarTwo(false)
    setSlideBarFour(false)
    setSlideBarFive(false)
    setSlideBarSix(false)

  }

  const [slideBarFour, setSlideBarFour] = useState(false)

  const slideBarActivFalseFour = () => {
    setSlideBarFour(!slideBarFour)

    setSlideBar(false)
    setSlideBarThree(false)
    setSlideBarTwo(false)
    setSlideBarFive(false)
    setSlideBarSix(false)


  }

  const [slideBarFive, setSlideBarFive] = useState(false)

  const slideBarActivFalseFive = () => {
    setSlideBarFive(!slideBarFive)

    setSlideBar(false)
    setSlideBarThree(false)
    setSlideBarTwo(false)
    setSlideBarFour(false)
    setSlideBarSix(false)

  }

  const [slideBarSix, setSlideBarSix] = useState(false)

  const slideBarActivFalseSix = () => 
  {

    setSlideBarSix(true)

    setSlideBarFive(false)
    setSlideBar(false)
    setSlideBarThree(false)
    setSlideBarTwo(false)
    setSlideBarFour(false)

  }

  const [burgerActive, setburgerActive] = useState(false)

  const burgerActiveFalse = () => {
      setburgerActive(!burgerActive)

      setbalanceHandle(false)
      setShowContent(false);
      setShowContentTwo(false);
      setShowContentThree(false);
      setShowContentfive(false);
      setShowContentfour(false);
      setAdminActive(false)

  }

  const navigate = useNavigate()

  const GoOut = () => {

    navigate('/')

    localStorage.removeItem('access_token')

  }

   const locationn = useLocation ()

    return(

      <>

      {locationn.pathname === '/' || locationn.pathname === '/restoring'
      || locationn.pathname === '/shipped' || (locationn.pathname.startsWith('/newpassword/') && locationn.pathname.length > '/newpassword/'.length)  || locationn.pathname === '/404' || locationn.pathname === '/passwordsuccessfully'

      ?

      ''      

      :

      <header className={h.header}>


          <div className={h.header__item}>

              <div className={h.header__padding} onClick={burgerActiveFalse}>

              <div 

              className={h.header__burger}

              >

                  <span></span>

              </div>

              </div>

              <Link to={'/admin_home'}>

              <img src={logo} className={h.header__logo} alt="img" />

              </Link>

          </div>

          <div className={h.header__admin}>

                  <div className={h.header__admin__box} onClick={AdminActiveFalse}>

                      <img src={user} className={h.header__admin__box__img} alt="svg" />

                      <img src={group} className={ AdminActive ? [h.header__admin__box__strel , h.header__admin__box__strel__active].join(' ') : [h.header__admin__box__strel] } alt="svg" />

                  </div>

          </div>

              {AdminActive &&

              <div className={h.header__modal}>

                  <div className={h.header__modal__item}>

                    {/* ////////////////////////////////////// */}

                      <div className={h.modal}>

                      <img src={item1} className={h.modal__svg} alt="svg" />

                      <p className={h.modal__title}>Консоль Администратора</p>

                      </div>

                  </div>

                  <div className={h.header__modal__item}>

                      <div className={h.modal}>

                      <img src={item2} className={h.modal__svg} alt="svg" />

                      <p className={h.modal__title}>Безопасность</p>

                      </div>

                      <div className={h.modal}>

                          <img src={item3} className={h.modal__svg} alt="svg" />

                          <p className={h.modal__title}>Техподдержка</p>

                      </div>

                  </div>

                  <div className={h.header__modal__item}>

                      <div className={h.modal}>

                      <img src={item4} className={h.modal__svg} alt="svg" />

                      <p className={h.modal__title}>Профиль</p>

                      </div>

                      <div className={h.modal}>

                          <img src={item5} className={h.modal__svg} alt="svg" />

                          <p className={h.modal__title}>Настройки</p>

                      </div>

                  </div>

                  <div className={h.header__modal__item} onClick={GoOut}>

                      <div className={h.modal}>

                      <img src={item6} className={h.modal__svg} alt="svg" />

                      <p className={h.modal__title}>Выйти</p>

                      </div>

                  </div>

              </div>

              }

      </header>

      }

      {locationn.pathname === '/' || locationn.pathname === '/restoring' 

      || locationn.pathname === '/shipped' || (locationn.pathname.startsWith('/newpassword/') && locationn.pathname.length > '/newpassword/'.length) || locationn.pathname === '/404' || locationn.pathname === '/passwordsuccessfully'

      ?

      ''      

      :

      !burgerActive ? (

        <div className={h.bar}>

           <div className={h.bar__balance}

                       onMouseEnter={balanceOne}
                       onMouseLeave={balanceOneClose}

           >

               <img src={bar1}  alt="svg" />

               {balanceHandle &&

               <div className={h.bar__info__balance}

               onMouseEnter={balanceOne}
               onMouseLeave={balanceOneClose}

               >

                   <p className={h.bar__info__title}>Баланс</p>

                   <ul className={h.bar__info__ul}>

                       <Link to={''} className={h.bar__info__balance__ul__link}>9 999 999 ₽</Link>

                   </ul>

               </div>

               }

           </div>

           <div className={h.bar__item}

           onMouseEnter={handleMouseEnter}
           onMouseLeave={handleMouseLeave}

           >

               <img src={bar2}  alt="svg" />

               {showContent &&

               <div className={h.bar__info}

               onMouseEnter={handleMouseEnter}
               onMouseLeave={handleMouseLeave}

               >

                   <p className={h.bar__info__title}>Площадки</p>

                   <ul className={h.bar__info__ul}>

                       <Link to={''} className={h.bar__info__ul__link}>Площадки</Link>

                       <Link to={''} className={h.bar__info__ul__link}>Мои площадки</Link>

                       <Link to={''} className={h.bar__info__ul__link}>Все площадки</Link>

                       <Link to={''} className={h.bar__info__ul__link}>Предложил сотрудничество <span>99+</span></Link>

                       <Link to={''} className={h.bar__info__ul__link}>Предлагают сотрудничество <span>99+</span> </Link>

                       <Link to={''} className={h.bar__info__ul__link}>Заработок</Link>

                       <Link to={''} className={h.bar__info__ul__link}>Статистика</Link>

                       <Link to={''} className={h.bar__info__ul__link}>Документы</Link>

                   </ul>

               </div>

               }

           </div>

           <div className={h.bar__item}

           onMouseEnter={MouseTwo}
           onMouseLeave={MouseLeaveTwo}

           >

               <img src={bar3}  alt="svg" />

               {showContentTwo &&

               <div className={h.bar__info}

               onMouseEnter={MouseTwo}
               onMouseLeave={MouseLeaveTwo}

               >

                   <p className={h.bar__info__title}>Рекламные кампании</p>

                   <ul className={h.bar__info__ul}>

                       <Link to={''} className={h.bar__info__ul__link}>Мои РК</Link>

                       <Link to={''} className={h.bar__info__ul__link}>Bco PK</Link>

                       <Link to={''} className={h.bar__info__ul__link}>Сотрудничаю</Link>

                       <Link to={''} className={h.bar__info__ul__link}>Предложил сотрудничество <span>99+</span></Link>

                       <Link to={''} className={h.bar__info__ul__link}>Поедлагают</Link>

                       <Link to={''} className={h.bar__info__ul__link}>сотрудничество <span>99+</span></Link>

                       <Link to={''} className={h.bar__info__ul__link}>Полнить баланс</Link>

                       <Link to={''} className={h.bar__info__ul__link}>Статистика</Link>

                       <Link to={''} className={h.bar__info__ul__link}>Документы</Link>


                   </ul>

               </div>

               }

           </div>

           <div className={h.bar__item}

           onMouseEnter={MouseThree}
           onMouseLeave={MouseLeaveThree}

           >

               <img src={bar4}  alt="svg" />

               {showContentThree &&

               <div className={h.bar__info}

               onMouseEnter={MouseThree}
               onMouseLeave={MouseLeaveThree}

               >

                   <p className={h.bar__info__title}>Финансы</p>

                   <ul className={h.bar__info__ul}>

                       <Link to={''} className={h.bar__info__ul__link}>Балансы</Link>

                       <Link to={''} className={h.bar__info__ul__link}>Пополнить вывести</Link>

                       <Link to={''} className={h.bar__info__ul__link}>История</Link>

                       <Link to={''} className={h.bar__info__ul__link}>Документы</Link>

                   </ul>

               </div>

               }

           </div>

           <div className={h.bar__item}

           onMouseEnter={Mousefour}
           onMouseLeave={MouseLeavefour}

           >

               <img src={bar5}  alt="svg" />

               {showContentfour &&

               <div className={h.bar__info}

               onMouseEnter={Mousefour}
               onMouseLeave={MouseLeavefour}

               >

                   <p className={h.bar__info__title}>Инструменты</p>

                   <ul className={h.bar__info__ul}>

                       <Link to={''} className={h.bar__info__ul__link}>Интерфейс</Link>

                       <Link to={''} className={h.bar__info__ul__link}>ShortLink</Link>

                       <Link to={''} className={h.bar__info__ul__link}>BestPredict</Link>

                       <Link to={''} className={h.bar__info__ul__link}>ReDesian</Link>

                       <Link to={''} className={h.bar__info__ul__link}>Advice +</Link>

                       <Link to={''} className={h.bar__info__ul__link}>Landing Page</Link>

                       <Link to={''} className={h.bar__info__ul__link}>CollectBench</Link>

                       <Link to={''} className={h.bar__info__ul__link}>AdvBrain</Link>

                       <Link to={''} className={h.bar__info__ul__link}>AnalyticReport</Link>

                       <Link to={''} className={h.bar__info__ul__link}>Statinteg</Link>

                       <Link to={''} className={h.bar__info__ul__link}>AntiCiaak</Link>

                       <Link to={''} className={h.bar__info__ul__link}>StonSclick</Link>

                   </ul>

               </div>

               }

           </div>

           <div className={h.bar__item}

           onMouseEnter={Mousefive}
           onMouseLeave={MouseLeavefive}

           >

               <img src={bar6}  alt="svg" />

               {showContentfive &&

               <div className={h.bar__info}

               onMouseEnter={Mousefive}
               onMouseLeave={MouseLeavefive}

               >

                   <p className={h.bar__info__title}>Статистика</p>

                   <ul className={h.bar__info__ul}>

                       <Link to={''} className={h.bar__info__ul__link}>Общая</Link>

                       <Link to={''} className={h.bar__info__ul__link}>Общая</Link>

                       <Link to={''} className={h.bar__info__ul__link}>Заявки</Link>

                       <Link to={''} className={h.bar__info__ul__link}>Офферы</Link>

                       <Link to={''} className={h.bar__info__ul__link}>Расходы</Link>

                       <Link to={''} className={h.bar__info__ul__link}>Заработок</Link>

                       <Link to={''} className={h.bar__info__ul__link}>Площадки</Link>

                       <Link to={''} className={h.bar__info__ul__link}>Трафик</Link>

                   </ul>

               </div>

               }

           </div>

           <div className={h.bar__setting}>

               <img src={setting}  alt="svg" />

           </div>

        </div>  

      ) : (

        <div className={h.slade}>

      {locationn.pathname === '/statistics' ?

      ''

      :

              <div className={h.slade__flex}>

              <p className={h.slade__title}>
              qrooto_test@gmail.com
              </p>

              <p className={h.slade__text}>
              Баланс
              </p>

              <p className={h.slade__sum}>
              9 999 999 ₽
              </p>

              <Link className={h.slade__btn} to={''}>
              Пополнить
              </Link>

              </div>

      }

              {/* item */}

      {locationn.pathname === '/statistics' ?

      <>

              <div className={h.slade__item}>

                <div className={h.slade__bar} onClick={slideBarActivFalseFive}>

                  <div className={h.slade__bar__img}>

                  <img src={arrow} alt=""

                  className={slideBarFive ? [h.slade__bar__arr, h.slade__bar__arr__active].join(' ') : [h.slade__bar__arr] }

                  />

                  <img src={bar6} alt="" />

                  </div>

                  <p className={h.slade__bar__title}>
                  Статистика
                  </p>

                </div>

                { slideBarFive && 

                <div className={h.slade__active}>

                  <Link to={'/statistics'} className={h.slade__active__link}>
                  Моя статистика
                  </Link>

                  <Link to={''} className={h.slade__active__link}>
                  Общая
                  </Link>

                  <Link to={''} className={h.slade__active__link}>
                  Заявки
                  </Link>

                  <Link to={''} className={h.slade__active__link}>
                  Офферы
                  </Link>

                  <Link to={''} className={h.slade__active__link}>
                  Расходы
                  </Link>

                  <Link to={''} className={h.slade__active__link}>
                  Заработок
                  </Link>

                  <Link to={''} className={h.slade__active__link}>
                  Площадки
                  </Link>

                  <Link to={''} className={h.slade__active__link}>
                  Трафик
                  </Link>

                </div>

                }


              </div> 

              <div className={h.slade__item}>

                <div className={h.slade__bar} onClick={slideBarActivFalse}>

                  <div className={h.slade__bar__img}>

                  <img src={arrow} alt=""

                  className={slideBar ? [h.slade__bar__arr, h.slade__bar__arr__active].join(' ') : [h.slade__bar__arr] }

                  />

                  <img src={bar7} alt="" />

                  </div>

                  <p className={h.slade__bar__title}>
                  Рекламодатели
                  </p>

                </div>

                { slideBar && 

                <div className={h.slade__active}>

                  <Link to={''} className={h.slade__active__link}>
                  Мои площадки
                  </Link>

                  <Link to={''} className={h.slade__active__link}>
                  Все площадки
                  </Link>

                  <Link to={''} className={h.slade__active__link}>
                  Сотрудничаю
                  </Link>

                  <Link to={''} className={h.slade__active__link}>
                  Предложил сотрудничество <span>+99</span>
                  </Link>

                  <Link to={''} className={h.slade__active__link}>
                  Предлагают сотрудничество <span>+99</span>
                  </Link>

                  <Link to={''} className={h.slade__active__link}>
                  Заработок
                  </Link>

                  <Link to={''} className={h.slade__active__link}>
                  Статистика
                  </Link>

                  <Link to={''} className={h.slade__active__link}>
                  Документы
                  </Link>

                </div>

                }


              </div>

              <div className={h.slade__item}>

                <div className={h.slade__bar} onClick={slideBarActivFalseTwo}>

                  <div className={h.slade__bar__img}>

                  <img src={arrow} alt=""

                  className={slideBarTwo ? [h.slade__bar__arr, h.slade__bar__arr__active].join(' ') : [h.slade__bar__arr] }

                  />

                  <img src={bar8} alt="" />

                  </div>

                  <p className={h.slade__bar__title}>
                  Площадки
